import React from 'react'

const Course = ( {course} ) => {
	return (
		<div>
			<h1>{course.name}</h1>
			<ul>
			course.parts.map(test => <li>{test.pa.name} </li>)
			</ul>

			{/* </ul> */}
		</div>
	)
}

const App = () => {
	const course = {
	  id: 1,
	  name: 'Half Stack application development',
	  parts: [
		{
		  name: 'Fundamentals of React',
		  exercises: 10,
		  id: 1
		},
		{
		  name: 'Using props to pass data',
		  exercises: 7,
		  id: 2
		},
		{
		  name: 'State of a component',
		  exercises: 14,
		  id: 3
		}
	  ]
	}

	return <Course course={course} />
  }

  export default App
